#
# View "reportfee"
#

DROP VIEW IF EXISTS `reportfee`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `reportfee`
  AS
SELECT
  `perusahaan`.`Nama` AS 'Perusahaan',
  `layanan`.`Nama` AS 'NamaLayanan',
  `layanan`.`Harga`,
  `pemesanan`.`KodePemesanan`,
  `pemesanandetail`.`Jumlah`,
  `pemesanan`.`VerifikasiPembayaran`,
  `pemesanan`.`StatusPesanan`,
  `pemesanan`.`KodeValidasi`,
  `pemesanan`.`IsEvent`,
  `pemesanan`.`CancelByUser`,
  `pemesanan`.`Tanggal`,
  (((`pemesanandetail`.`Jumlah` * `layanan`.`Harga`) * 10) / 100) AS 'Fee',
  IF((`pemesanan`.`CancelByUser` = 0), (((`pemesanandetail`.`Jumlah` * `layanan`.`Harga`) * 20) / 100), (`pemesanandetail`.`Jumlah` * `layanan`.`Harga`)) AS 'biaya',
  `layanan`.`Unit`,
  `pelanggan`.`Nama` AS 'Pelanggan',
  `jenisevent`.`Nama` AS 'JenisEvent'
FROM
  (((((`pemesanandetail`
    LEFT JOIN `layanan` ON ((`pemesanandetail`.`IdLayanan` = `layanan`.`Id`)))
    LEFT JOIN `perusahaan` ON ((`layanan`.`IdPerusahaan` = `perusahaan`.`Id`)))
    LEFT JOIN `pemesanan` ON ((`pemesanandetail`.`IdPemesanan` = `pemesanan`.`Id`)))
    LEFT JOIN `pelanggan` ON ((`pemesanan`.`IdPelanggan` = `pelanggan`.`Id`)))
    LEFT JOIN `jenisevent` ON ((`pemesanan`.`JenisEventId` = `jenisevent`.`Id`)));

#
# View "reportfeeevent"
#

DROP VIEW IF EXISTS `reportfeeevent`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `reportfeeevent`
  AS
SELECT
  `perusahaan`.`Nama` AS 'Perusahaan',
  `pemesanan`.`KodePemesanan`,
  `pemesanan`.`VerifikasiPembayaran`,
  `pemesanan`.`StatusPesanan`,
  `pemesanan`.`KodeValidasi`,
  `pemesanan`.`IsEvent`,
  `pemesanan`.`CancelByUser`,
  `pemesanan`.`Tanggal`,
  `pelanggan`.`Nama` AS 'Pelanggan',
  `jenisevent`.`Nama` AS 'JenisEvent',
  IF((`pemesanan`.`CancelByUser` = 0), ((`penawaran`.`Biaya` * 20) / 100), `penawaran`.`Biaya`) AS 'biaya'
FROM
  ((((`pemesanan`
    LEFT JOIN `pelanggan` ON ((`pemesanan`.`IdPelanggan` = `pelanggan`.`Id`)))
    LEFT JOIN `jenisevent` ON ((`pemesanan`.`JenisEventId` = `jenisevent`.`Id`)))
    LEFT JOIN `penawaran` ON ((`pemesanan`.`Id` = `penawaran`.`IdPemesanan`)))
    LEFT JOIN `perusahaan` ON ((`penawaran`.`IdPerusahaan` = `perusahaan`.`Id`)))
WHERE
  (`pemesanan`.`IsEvent` = 'true');

